import React from "react";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Container from "@mui/material/Container";
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import './Home.css'
import { useNavigate } from "react-router-dom";

export default function Home() {

    const navegate = useNavigate();
    const logout = () =>{
        navegate("/")
    }

  return (
    <div className="mainPage">
      <AppBar position="static" style={{ backgroundColor:"#80cbc4"}}>
        <Container maxWidth="90%">
          <Toolbar disableGutters>
            <img
              src="https://vyaparwebsiteimages.vypcdn.in/logo1.svg"
              style={{ width: "20%" }}
            />

            <Stack direction="row" spacing={2}>
              <Button href="/Home" className="menuButton" style={{color:"black", fontSize:"30px" }}>Home</Button>
              <Button href="/Home" className="menuButton" style={{color:"black", fontSize:"30px" }}>Users</Button>
              <Button href="/Home" className="menuButton" style={{color:"black", fontSize:"30px" }}>Bill Details</Button>
              <Button href="/invoice" className="menuButton" style={{color:"black", fontSize:"30px" }}>Invoice</Button>
              <Button href="/MainContent" className="menuButton" style={{color:"black", fontSize:"30px" }}>Create Invoice</Button>
              <Button href="" className="menuButton" style={{color:"black", fontSize:"30px" }}>About</Button>
            </Stack>
            <Button variant="contained" size="large" style={{marginLeft:"6rem"}} onClick={logout}>
          Logout
        </Button>
          </Toolbar>
        </Container>
      </AppBar>
    </div>
  );
}
